  display: flex;
  flex-direction: column;
  justify-content: flex-end;
}
.album-information__heading {
  font-weight: bold;
  color: #fff;
  margin-bottom: 20px;
}
@media (min-width: 1200px) {
  .album-information__heading {
    font-size: 50px;
  }
}
.album-information__heading a {
  text-decoration: none;
}
.album-information__subheading {
  color: #e7e7e7;
  text-transform: uppercase;
  font-size: 0.875rem;
  font-weight: bold;
  margin-bottom: 15px;
}
.album-information__text {
  color: #8D8D8D;
  line-height: 20px;
}
.album-information__text strong {
  color: #e7e7e7;
  font-weight: normal;
}

.album-window {
  margin: 50px 0;
}

.album-list {
  padding: 0;
  margin: 0;
  white-space: nowrap;
  overflow-x: auto;
}
.album-list::-webkit-scrollbar-track {
  border-radius: 10px;
  background-color: transparent;
}
.album-list::-webkit-scrollbar {
  width: 10px;
  height: 10px;
  box-shadow: inset 0 0 6px rgba(0, 0, 0, 0.4);
  border-radius: 10px;
  background-color: transparent;
}
.album-list::-webkit-scrollbar-thumb {
  border-radius: 10px;
  box-shadow: inset 0 0 6px rgba(0, 0, 0, 0.3);
  background-color: #8D8D8D;
  height: 25px;
}
.album-list:first-of-type {
  margin-bottom: 75px;
}

.album-card {
  display: block;
  text-decoration: none;
}
.album-card:hover {
  text-decoration: none;
}
.album-card:hover .album__cover {
  opacity: 0.3;
}

.album {
  list-style-type: none;
  display: inline-block;
  margin: 0 10px 30px;
  max-width: calc(25% - 20px);
}
.album:first-of-type {
  margin-left: 0;
  max-width: calc(25% - 20px);
}
.album:last-of-type {
  margin-right: 0;
  max-width: calc(25% - 20px);
}
.album__cover {
  width: 100%;
  height: auto;
  max-width: 250px;
  max-height: 250px;
  transition: opacity ease-in-out 0.2s;
}
.album__title {
  overflow: hidden;
  text-overflow: ellipsis;
  display: -webkit-box;
  -webkit-line-clamp: 1;
  -webkit-box-orient: vertical;
  margin: 20px 0 0;
}
.album__title:hover {
  text-decoration: underline;
}
.album__artist-link {
  text-decoration: none;
}

.footer-info {
  display: inline-flex;
  flex-direction: row;
  align-items: center;
  flex-wrap: wrap;
}
.footer-info__title {
  margin-left: 15px;
  margin-bottom: 0;
}
.footer-info .copy {
  margin-top: 25px;
  margin-bottom: 25px;
  flex-basis: 100%;
}

.footer {
  max-width: 1600px;
  margin: auto;
  padding: 75px 30px;
}
.footer__logo {
  width: 40px;
  height: 40px;
}
.footer__logo .fill {
  fill: #fff;
}
.footer__link:hover .fill {
  fill: #1ED760;
}

.artist-card {
  display: block;
  text-decoration: none;
}
.artist-card:hover {
  text-decoration: none;
}
.artist-card:hover .artist__cover {
  opacity: 0.3;
}

.album-window {
  margin: 50px 0;
}

.artist-information {
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: flex-end;
}
.artist-information__heading {
  font-weight: bold;
  color: #fff;
  margin-bottom: 20px;
}
@media (min-width: 1200px) {
  .artist-information__heading {
    font-size: 50px;
  }
}
.artist-information__subheading {
  color: #e7e7e7;
  text-transform: uppercase;
  font-size: 0.875rem;
  font-weight: bold;
  margin-bottom: 15px;
}
.artist-information__text {
  color: #8D8D8D;
  line-height: 20px;
}
.artist-information__text strong {
  color: #e7e7e7;
  font-weight: normal;
}

.artist__cover {
  padding: 15px;
  width: 100%;
  height: auto;
  max-width: 250px;
  max-height: 250px;
  transition: opacity ease-in-out 0.2s;
  border-radius: 50%;
}
.artist__title {
  overflow: hidden;
  text-overflow: ellipsis;
  display: -webkit-box;
  -webkit-line-clamp: 1;
  -webkit-box-orient: vertical;
  text-align: center;
  margin: 20px 0 0;
}
.artist__title:hover {
  text-decoration: underline;
}
.artist__link {
  text-decoration: none;
}

.login-window {
  margin-top: 100px;
}
.login-window__title {
  font-size: 5.3125rem;
  margin-bottom: 50px;
  color: #1ED760;
}
@media (max-width: 1199.98px) {
  .login-window__title {
    font-size: 2rem;
  }
}

.login-form {
  background: linear-gradient(-120deg, #2D46B9 25%, #1ED760 100%);
  border-radius: 15px;
  padding: 30px;
}
.login-form label {
  margin-bottom: 10px;
}

.login {
  background-color: #2D46B9;
}
.login .footer {
  margin-top: 75px;
  width: 100%;
  background-color: #000;
}

.track-table {
  display: table;
  border-collapse: separate;
  width: 100%;
  margin-bottom: 40px;
}

.track-thead {
  display: table-row;
  vertical-align: middle;
}

.track-head {
  display: table-cell;
  color: #8D8D8D;
  font-size: 0.75rem;
  text-align: left;
  font-weight: bold;
  letter-spacing: 2px;
  padding-bottom: 10px;
  text-transform: uppercase;
}
.track-thead .track-head:first-of-type {
  padding-left: 50px;
}

.track-entry {
  display: table-row;
  vertical-align: middle;
  text-decoration: none;
  transition: box-shadow ease-in-out 0.18s;
  color: #7f8fa4;
  text-align: left;
  border-radius: 4px;
}
.track-entry:hover {
  text-decoration: none;
  background-color: rgba(141, 141, 141, 0.2);
}
.track-entry:hover .track-item {
  padding: 13px 0 12px;
  border-top: none;
}
.track-entry:hover:last-of-type .track-item {
  padding-top: 13px;
  padding-bottom: 13px;
  border-bottom: none;
}

.track-item {
  display: table-cell;
  font-weight: bold;
  font-size: 0.875rem;
  color: #e7e7e7;
  border-top: 1px solid rgba(255, 255, 255, 0.2);
  padding: 12px 0;
}
.track-entry .track-item:first-of-type {
  padding-left: 50px;
}
.track-entry .track-item:first-of-type .form-group {
  margin: 0 15px 0 0;
}
.track-entry:last-of-type .track-item {
  border-bottom: 1px solid rgba(255, 255, 255, 0.2);
}
.track-item a {
  color: #e7e7e7;
  text-decoration: none;
}
.track-item a:hover {
  text-decoration: underline;
}
.track-item .form-group {
  margin: 0 15px 0;
}
.track-item .form-group input {
  color: #fff;
  background-color: #282828;
  border: 0;
}
.track-item .form-group input::placeholder {
  color: #fff;
}

.browse-collection .album-card {
  margin-bottom: 30px;
}

